import React, { Component } from 'react';
import './App.scss';

class Gif extends Component {
  render() {
    const src="https://media3.giphy.com/media/26tPplGWjN0xLybiU/200.gif?cid=ecf05e477t72s1dbv2wzukmhwex9su0bsccftis2u61o78i9&rid=200.gif&ct=g"
    return (
      <img className="gif" src={src} alt="gif"></img>
    )
  }
}

export default Gif;
